<template>
  <div class="device-card-list-wrapper p-2">
    <div class="p-4 bg-white" style="margin-bottom: 10px">
      <BasicForm @register="registerForm" @reset="handleSubmit"/>
    </div>
    <div class="p-2 bg-white">
      <Spin :spinning="state.loading">
        <List
          :grid="{ gutter: 2, xs: 1, sm: 4, md: 6, lg: 6, xl: 8, xxl: 8 }"
          :data-source="data"
          :pagination="paginationProp"
        >
          <template #header>
            <div
              style="display: flex;align-items: center;justify-content: space-between;flex-direction: row;">
              <span style="padding-left: 7px;font-size: 16px;font-weight: 500;line-height: 24px;">视频数据集列表</span>
              <div class="space-x-2">
                <slot name="header"></slot>
              </div>
            </div>
          </template>
          <template #renderItem="{ item }">
            <ListItem style="padding: 0;
                background: #FFFFFF;
                box-shadow: 0px 0px 4px 0px rgba(24, 24, 24, 0.1);
                height: 100%;
                transition: all 0.3s;
            }">
              <div class="list5-box imgh">
                <a class="img-box" :title="item['name']" :onclick="handleView.bind(null, item)">
                  <img
                    :src="item['coverPath']"
                    alt="" style="height: 188px; width: 100%;">
                </a>
                <div class="list5-cont" style="padding: 15px">
                  <div>
                    <Tag color="green">{{ item['description'] }}</Tag>
                  </div>
                  <div class="btns" style="padding-top: 5px;">
                    <Popconfirm
                      title="是否确认删除？"
                      ok-text="是"
                      cancel-text="否"
                      @confirm="handleDelete(item)"
                    >
                      <div class="btn">
                        <img
                          src="data:image/png;base64,"
                          alt="">
                      </div>
                    </Popconfirm>
                    <div class="btn" :onclick="handleCopy.bind(null, item)">
                      <img
                        src="data:image/png;base64,"
                        alt="复制">
                    </div>
                    <div class="btn" :onclick="handleEdit.bind(null, item)">
                      <img
                        src="data:image/png;base64,"
                        alt="编辑">
                    </div>
                    <div class="btn" :onclick="handleLoadVideo.bind(null, item)">
                      <img
                        src="data:image/png;base64,"
                        alt="视频加载">
                    </div>
                    <Popconfirm
                      title="是否确认抽帧？"
                      ok-text="是"
                      cancel-text="否"
                      @confirm="handleFrame(item)"
                    >
                      <div class="btn">
                        <img
                          src="data:image/png;base64,"
                          alt="视频抽帧">
                      </div>
                    </Popconfirm>
                  </div>
                </div>
              </div>
            </ListItem>
          </template>
        </List>
      </Spin>
    </div>
  </div>
</template>
<script lang="ts" setup>
import {onMounted, reactive, ref} from 'vue';
import {List, Popconfirm, Spin, Tag} from 'ant-design-vue';
import {propTypes} from '@/utils/propTypes';
import {isFunction} from '@/utils/is';
import {useMessage} from "@/hooks/web/useMessage";
import {BasicForm, useForm} from "@/components/Form";
import {useRoute} from "vue-router";

defineOptions({name: 'DatasetVideoCardList'})

const {createMessage} = useMessage()

const route = useRoute()

const ListItem = List.Item;
// 组件接收参数
const props = defineProps({
  // 请求API的参数
  params: propTypes.object.def({}),
  //api
  api: propTypes.func,
});
//暴露内部方法
const emit = defineEmits(['getMethod', 'delete', 'edit', 'view', 'load-video', 'frame']);

const data = ref([]);
const state = reactive({
  loading: true,
});

//表单
const [registerForm, {validate}] = useForm({
  schemas: [
    {
      field: `name`,
      label: `视频名称`,
      component: 'Input',
    },
  ],
  labelWidth: 80,
  baseColProps: {span: 6},
  actionColOptions: {span: 18},
  autoSubmitOnEnter: true,
  submitFunc: handleSubmit,
});

//表单提交
async function handleSubmit() {
  const data = await validate();
  await fetch(data);
}

// 自动请求并暴露内部方法
onMounted(() => {
  fetch();
  emit('getMethod', fetch);
});

async function fetch(p = {}) {
  const {api, params} = props;
  params['datasetId'] = route.params['id']
  if (api && isFunction(api)) {
    const res = await api({...params, pageNo: page.value, pageSize: pageSize.value, ...p});
    data.value = res.list;
    total.value = res.total;
    hideLoading();
  }
}

function hideLoading() {
  state.loading = false;
}

//分页相关
const page = ref(1);
const pageSize = ref(16);
const total = ref(0);
const paginationProp = ref({
  showSizeChanger: false,
  showQuickJumper: true,
  pageSize,
  current: page,
  total,
  showTotal: (total: number) => `总 ${total} 条`,
  onChange: pageChange,
  onShowSizeChange: pageSizeChange,
});

function pageChange(p: number, pz: number) {
  page.value = p;
  pageSize.value = pz;
  fetch();
}

function pageSizeChange(_current, size: number) {
  pageSize.value = size;
  fetch();
}

async function handleDelete(record: object) {
  emit('delete', record);
}

async function handleLoadVideo(record: object) {
  emit('load-video', record);
}

async function handleFrame(record: object) {
  emit('frame', record);
}

async function handleView(record: object) {
  emit('view', record);
}

async function handleEdit(record: object) {
  emit('edit', record);
}

async function handleCopy(record: object) {
  await navigator.clipboard.writeText(JSON.stringify(record));
  createMessage.success('复制成功');
}
</script>

